<div class="large-12 medium-12 small-12 left content-post">

	
	<p>Você já ouviu falar do <strong>Kasino</strong>? Ao contrário do que o<strong> Gilberto Barros</strong> pensa, não se trata de um artista, mas sim de um grupo brasileiro que tentou fazer sucesso nos anos 2000 (e está até hoje tentando). Seu hit foi a música &#8220;<strong>Can&#8217;t Get Over</strong>&#8221; que fez parte da trilha sonora da novela América.</p>
<p><img src="http://www.naosalvo.com.br/wp-content/uploads/2016/10/kasino.jpg" alt="" /></p>
<h2>E no dia 07/10/2006 isso aconteceu:</h2>
<p><iframe src="https://www.youtube.com/embed/LCDaw0QmQQc" width="854" height="480" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>
<p>Pronto. Desde então <strong>Kasino</strong> virou <strong>Kassinão</strong> e<strong> Can&#8217;t Get Over</strong> virou Quem <strong>Guerôver</strong>. Ooooooutro detalhe é que o Kasino é brasileiro, não tinha nada de internacional UAHUAHUAHUAH</p>
<p>O vídeo virou um meme eterno, cheio de frases da do <strong>Gilberto Barros</strong>:</p>
<p><em>&#8211; VAI DJJ!!!!<br />
&#8211; KASINO AE!!<br />
&#8211; O som da noite! As baladas!</em></p>
<p><img src="http://www.naosalvo.com.br/wp-content/uploads/2016/10/kasinao.gif" width="710" /></p>
<p>O problema é que o Kassinão não gostou do apelido e até hoje, 10 anos depois, é ressentido com o ocorrido:</p>
<p><img src="http://www.naosalvo.com.br/wp-content/uploads/2016/10/kasino2.jpg" alt="" /></p>
<p>E o vocalista fez um desabafo:</p>
<p><img src="http://www.naosalvo.com.br/wp-content/uploads/2016/10/kasino3.jpg" alt="" /></p>
<p>Eeeee Kassinão..<br />
Vamos parar de te chamar de <em>Kassinãooooooooooooooo</em>!</p>
<p>Só toca Quem Guerôver novamente!</p>
<p><img src="http://www.naosalvo.com.br/wp-content/uploads/2016/10/kasinao2.gif" width="710" /></p>
</div>
